import React from "react";
import { styled } from "styled-components";

const Div = styled.div`
  width: 290px;
  height: 290px;
  // background: #f5a623;
  border-radius: 10px;
`;

export default function CityItem(props) {
  return (
    <Div>
      <img src={props.image} alt="city" />
    </Div>
  );
}
